import Hero from "./hero";
const Home = () => {
  return (
    <>
      <Hero text="Welcome to Movie Search" />
      <div className="container">
        <div className="row">
          <div className="col-lg-8 offset-lg-2 my-5">
            <p className="lead">
              This website is currently under maintenance. My plan is to make getting information about
              movies easy. This website is using TMDB's API to get information about movies. I am
              currently working on making search button functional and making it look like google on
              mobile phones.
            </p>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
